from Clock import Clock

clock = Clock()


class Solution:
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        clock.time()
        numrows = len(grid)

        # prevent [], none
        if not numrows:
            return 0

        queue = []
        used = []
        num_island = 0

        numcols = len(grid[0])

        grid_fill0 = [['0' for _ in range(numcols + 2)]
                      for _ in range(numrows + 2)]

        for row in range(numrows):
            grid_fill0[row + 1][1: numcols + 1] = grid[row]

        # 1-d list
        if not isinstance(grid[0], list):
            numcols = numrows
            numrows = 1

            grid_fill0 = [['0' for _ in range(numcols + 2)]
                          for _ in range(numrows + 2)]

            grid_fill0[1][1: numcols + 1] = grid

        gen = ((row, col) for row in range(1, numrows + 1)
               for col in range(1, numcols + 1))
        clock.time()
        clock.time()

        for row, col in gen:
            if (grid_fill0[row][col] == '1') and ((row, col) not in used):
                queue.append((row, col))
                used.append((row, col))

                num_island += 1

                while (queue):
                    for _ in range(len(queue)):
                        cur_row, cur_col = queue[0]

                        for (next_row, next_col) in ((cur_row - 1, cur_col), (cur_row + 1, cur_col), (cur_row, cur_col - 1), (cur_row, cur_col + 1)):
                            if grid_fill0[next_row][next_col] == '1' and ((next_row, next_col) not in used):
                                queue.append((next_row, next_col))

                            used.append((next_row, next_col))

                        queue.pop(0)
        clock.time()

        return num_island


